text:
So there are a lot of posts here about personal knowledge databases &amp; note taking apps ... and methodologies.  I wanted a way to keep track of info &amp; just as importantly be able to easily see &amp; edit that data from anywhere.<p>I wanted it to be robust, free, web-based, able to host code examples as actual files (e.g. style.css or script.js), and host images.<p>Turns out this is all available with Github &amp; Gitlab.<p>Step 1: Create a Private Repo
Step 2: Hit the . key or use the editor URL pattern: https:&#x2F;&#x2F;github.dev&#x2F;{{username}}&#x2F;{{repo-name}}
Step 3: Start using ... you can add sub-directories with Markdown for notes ... you can add all the file types above.<p>For Gitlab just click &quot;Web IDE&quot; from your project&#x27;s homepage.<p>(I made this URL: https:&#x2F;&#x2F;github.dev&#x2F;{{username}}&#x2F;{{repo-name}} my homepage, making it super easy to access.)<p>This is absolutely nothing new; but the epiphany I had a week or so ago about using a repo in this way seems to have really stuck (yes, a week is a short period of time but often a note app or approach sticks for a day or 2 for me).<p>I&#x27;m really curious if others do something like this &amp; what other sorts of practices they might employ while doing this.

From the perspective of static site generation, is there a tool to compile HTML+CSS in order to minimize download size?<p>I&#x27;m imagining something which takes the following HTML+CSS:<p><pre><code>    &lt;style&gt;
    h1{color:red;}
    h2{color:blue;}
    .custom{display:none;}
    .custom2{display:inline;}
    &lt;&#x2F;style&gt;
    ...
    &lt;h2&gt;Hello&lt;&#x2F;h2&gt;
    &lt;div class=&quot;custom&quot;&gt;
     &lt;p&gt;lorem ipsum&lt;&#x2F;p&gt;
     &lt;p&gt;dolor sit amet&lt;&#x2F;p&gt;
    &lt;&#x2F;div&gt;
</code></pre>
And transforms it into this:<p><pre><code>    &lt;h2 style=&quot;color:blue&quot;&gt;Hello&lt;&#x2F;h2&gt;
    &lt;div style=&quot;display:none&quot;&gt;
     &lt;p&gt;lorem ipsum&lt;&#x2F;p&gt;
     &lt;p&gt;dolor sit amet&lt;&#x2F;p&gt;
    &lt;&#x2F;div&gt;
</code></pre>
However, it should not always inline the css styles, because sometimes that would cause the result to be larger than the original, like this:<p><pre><code>    &lt;style&gt;
    h1{color:red;}
    h2{color:blue;}
    .custom{display:none;}
    .custom2{display:inline;background-color:yellow;}
    &lt;&#x2F;style&gt;
    ...
    &lt;h2&gt;Hello&lt;&#x2F;h2&gt;
    &lt;div class=&quot;custom2&quot;&gt;
     &lt;p class=&quot;custom2&quot;&gt;lorem ipsum&lt;&#x2F;p&gt;
     &lt;p class=&quot;custom2&quot;&gt;dolor sit amet&lt;&#x2F;p&gt;
    &lt;&#x2F;div&gt;
</code></pre>
Here, &lt;p class=&quot;custom2&quot;&gt; is shorter than &lt;p style=&quot;display:inline;background-color:yellow;&quot;&gt;, so it should remain unchanged.<p>I&#x27;m not talking about tools like https:&#x2F;&#x2F;htmlcompressor.com&#x2F;compressor&#x2F; which only remove whitespace, or gzip compression. What I want is something that understands the semantics of HTML+CSS and can intelligently inline iff that reduces the size of the resulting HTML file.
